clientId="842516165307-tgselej93rqplidfcdu6rttl1drdt8eu.apps.googleusercontent.com"
onSuccess={responseGoogle}
onFailure={responseGoogle}>    
</GoogleLogin> */}
    </div>
    
            </section>

            </center>

    );

}

export default Logins;
